import React from "react";
import logo from './Moss1.jpg';
import logo2 from './Moss2.jpg';

function Projects() {
    return (
        <div>
            <header>
                <h1 className="chicago">Projects</h1>
                <h2 className="chicago" style={{marginRight: "50%"}}>Virtual Art Gallery</h2>
                <p className="chicago" style={{marginRight: "40%"}}>
                    For my Human-Computer Interaction for my Bachelor's degree, I assisted in working on a virtual art gallery within the metaverse using a 3D model of the Moss Arts Center at Virginia Tech.
                </p>
                <p className="chicago" style={{marginLeft: "40%"}}>
                     Shown is a photo of the exhibit when it was close to finished, just missing some snap to view buttons that we had placed on the back right wall shown in the first image. 
                </p>
                <img src={logo} className="App-logo" alt="logo" />
                <p className="chicago">
                     You had the ability to upload to the exhibit and display your own photos or videos.
                </p>
                <img src={logo2} className="App-logo" alt="logo" />
            </header>
        </div>
    );
}

export default Projects;
